import React from 'react'
import styled from 'styled-components';

const Section=styled.div`
height:100vh;
background-color:red;
scroll-snap-align:center;
`;

const WhoComponent = () => {
  return (
    <Section>
          <ParallaxContainer>
      {parallaxOffsets.map((offset, index) => (
        <ParallaxImage
          key={index}
          src={`image${index + 1}.jpg`} // Replace with your image URLs
          offset={offset}
        />
      ))}
    </ParallaxContainer>
    </Section>
  )
}

export default WhoComponent
